import Links from '../Pages/PageLinks';
import { Link } from 'react-router-dom';
import './StyleHome.css';
export const Home = () => {
    return(
        <div className='flex justify-center items-center flex-col' style={{backgroundColor: '#4F4F4F', height: '100vh'}}>
            <div className="flex justify-center">
                <h1 className='main-title'>Hey, my name is Juan Augusto, I'm glad you're here.</h1>
            </div>
            <div className="card" style={{ width: "24rem"}}>
              <img src="https://reactjs.org/logo-og.png" class="card-img-top" alt="..."/>
                <div className="card-body">
                    <p class="card-text">This is a compilation of exercises using ReactJS, with different methods and solutions.</p>
                    <p>
                        <a class="btn btn-primary" data-bs-toggle="collapse" href="#collapseExample" role="button" aria-expanded="false" aria-controls="collapseExample">
                            Show exercises
                        </a>
                    </p>
                    <div class="collapse" id="collapseExample">
                    <div class="card card-body">
                        <ul>
                            {
                                Links.map((item, key) => (
                                    <Link to={`${item.link}`}><li className="dropdown-item" key={key}>{`${item.name}`}</li></Link>
                                ))
                            }
                        </ul>
                    </div>
                    </div>
                </div>
            </div> 
        </div>
    );
}
